import React from 'react'
import {
    CardBody,
    Card,
} from 'reactstrap';

import './Dashboard.css'
const Employees = (props) => {
    return (
        <div>
            <Card className='top-bar'>
                <CardBody>
                    <ButtonGroup size='md'>
                        <Button className='active'>
                            Admin Dashboard
                   </Button>
                        <Button>
                            Admin Dashboard
                   </Button>
                    </ButtonGroup>
                </CardBody>
            </Card>
        </div>
    );
}

export default Employees;
